import React from "react";
import {Col, Row} from "react-bootstrap";
import {CgCPlusPlus} from "react-icons/cg";
import {
    DiJavascript1,
    DiReact,
    DiNodejs,
    DiMongodb,
    DiPython,
    DiGit,
} from "react-icons/di";
import {
    FaFacebookF,
    FaTwitter,
    FaInstagram,
    FaPinterest,
    FaJava
} from "react-icons/fa";

import {SiPytorch, SiTensorflow, SiFirebase, SiSpring} from "react-icons/si";

function Techstack() {

    let circleClasses = "inline-block p-7 rounded-full w-20 mx-auto";
    let iconStyles = {color: "white", fontSize: "1.5em"};

    return (
        <Row style={{justifyContent: "center", paddingBottom: "50px"}}>
            <div className="App grid grid-cols-2 sm:grid-cols-4 gap-2 w-3/4 mx-auto">
                <h1 className="col-span-full">Icon Demo</h1>
                <span style={{background: "#3B5998"}} className={circleClasses}>
                <FaFacebookF style={iconStyles}/>
                </span>
            </div>
            <Col xs={4} md={2} className="tech-icons">
                <DiJavascript1/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <DiNodejs/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <DiReact/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <DiMongodb/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <DiPython/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <DiGit/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <SiFirebase/>
            </Col>
            <Col xs={4} md={2} className="tech-icons">
                <SiSpring/>
            </Col>
        </Row>
    );
}

export default Techstack;
